INSERT INTO `NGOEntry` VALUES (3122,'Madhu Mansion Charitable Trust','5th Main, Vasa layout,\nMarathahalli Bridge, Bangalore','For years, Brother Samson along with his wife has been providing a loving home to about 40 kids who has nowhere else to be. \n\nThe kids are provided as best a care as the duo can afford with their meager salary and some support from the community. \nAll the kids are under 14 years and go to good private English schools. \n\nThe orphanage is just barely getting its ends met with last minute hustle to meet month\'s Grocery needs or school fees for the kids. \n\nWe welcome you to come visit us and spend some time, play games and interact with our kids.','08033910377','madhumansiontrust@gmail.com ','Mr. Samson',NULL,'https://www.facebook.com/madhumansion','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/01.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/2.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/03.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/4.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/5.jpg\"\n]','{\n	\"1\": [{\n		\"slotStartHour\": 10,\n		\"slotEndtHour\": 12,\n		\"displayString\": \"10-12am\"\n	}, {\n		\"slotStartHour\": 12,\n		\"slotEndtHour\": 14,\n		\"displayString\": \"12-2pm\"\n	}, {\n		\"slotStartHour\": 14,\n		\"slotEndtHour\": 17,\n		\"displayString\": \"2-5pm\"\n	}],\n	\"2\": [{\n		\"slotStartHour\": 14,\n		\"slotEndtHour\": 16,\n		\"displayString\": \"2-4pm\"\n	}, {\n		\"slotStartHour\": 16,\n		\"slotEndtHour\": 18,\n		\"displayString\": \"4-6pm\"\n	}],\n	\"3\": [{\n		\"slotStartHour\": 14,\n		\"slotEndtHour\": 16,\n		\"displayString\": \"2-4pm\"\n	}, {\n		\"slotStartHour\": 16,\n		\"slotEndtHour\": 18,\n		\"displayString\": \"4-6pm\"\n	}],\n	\"4\": [{\n		\"slotStartHour\": 14,\n		\"slotEndtHour\": 16,\n		\"displayStr