08c.appspot.com/NGO_cause_images/srisai/srisai-thumbnail.jpg',300,NULL,'2017-08-13 06:41:07'),(3124,'Make-A-Wish Foundation','144-145 Raheja Arcade, Koramangala, Bengaluru, Karnataka 560095\n','We grant the wishes of children with life-threatening medical conditions to enrich the human experience with hope, strength and joy. Adopting a Wish or number of wishes give(s) a great satisfaction and a sense of emotional fulfillment to an individual. Each individual well wisher could join the cause by adopting one wish and or more than one wish according to his / her choice.','080955 02518','bangalore.div@makeawishindia.org','Ms Laxmi Arun',NULL,'http://www.makeawishindia.org/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/01.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/2.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/3.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/1.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/4.jpg\"\n]',NULL,12.93445200,77.54338570,NULL,'/ngos/make-a-wish-foundation.php','We grant the wishes of children with life-threatening medical conditions to enrich the human experience with hope, strength and joy. ','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/makeAWish/makeAwish_thum.jpg',334000,NULL,'2017-08-10 12:00:36'),(3125,'Makkala Jagriti','Multiple locations in Bangalore','Makkala jagriti has been changing the lives of marginalized kids at the grass root level for the last 12 years. \n\nIt runs multiple community learning centres with the help of volunteers who provide these kids a great learning opportunities in their area of interest like spoken English, computers, etc. \n\nIt supports modern learning and development at multiple government schools in Bangalore and welcomes volunteers to help teach these kids.','08023339865','sunayana@makkalajagriti.org','Mr. Thilaka Selvan',NULL,'http://makkalajagriti.org/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/1.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/2.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/3.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/4.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/5.jpg\"\n]',NULL,13.03099420,77.52365540,NULL,'/ngos/makkala-jagriti.php','Makkala jagriti runs multiple community learning centres with the help of volunteers who provide poor kids great learning opportunities like spoken English, computers, etc','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/MJ/mj_thubnail.jpg',10000,NULL,'2017-08-10 10:39:05'),(3126,'Manav Charities','# 66,14th Main, Kammagondanhalli, Jalahalli, Bengaluru, Karnataka 560015','Nutritious meal to underprivileged children in 19 locations of India. Informal School for the drop out and children’s of labors. Distribution of free notebooks, school bags, uniform, shoes/socks and other educational kits to the underprivileged children.  ','09342358091','rajkul@manavcharities.in',NULL,NULL,'http://manavcharities.in/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/1.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/3.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/4.jpg\"\n]',NULL,13.06500820,77.45957020,NULL,'http://manavcharities.in/','Nutritious meal to underprivileged children in 19 locations of India. Informal School for the drop out and children’s of labors. Distribution of free notebooks, school bags, uniforms & other educational kits to the underprivileged children.  ','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manav_thumbnail.jpg',21000,NULL,'2017-08-13 06:42:20'),(3127,'Snehadeep Helping Hands','36, Charles Campbell Rd, Cox Town, Bengaluru, Karnataka 560005','The principal goals of Snehadeep are to provide accommodation, education, training and assistance with personal development to both the visually impaired and physically challenged. In recent years, the organization has grown and now extends its activities to shelter not only those with physical disability but also children from economically disadvantaged backgrounds.','08025801069','snehadeeptrust@gmail.com','Mr. Paul',NULL,'http://snehadeep.org/','[\"http://static.dnaindia.com/locality/sites/default/files/styles/news_slider/public/newsimage/visually-challenged.jpg?itok=fdmHstJp\"]',NULL,12.99614050,77.55352320,NULL,'http://www.snehadeep.org/','Providing accommodation, education, training and assistance with personal development to both the visually impaired and physically challenged.','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/snahdeep/snahdeep_thumbnail.jpg',1200,NULL,'2017-08-13 06:43:39'),(3128,'Lovedale Foundation','#35/2 A,4th Cross,, Chelekere Main Road,, Kalyan Nagar POST, Bengaluru, Karnataka 560077','Lovedale Foundation’s Banyan School provides top class education facilities to the marginalized  children in  rural Bangalore. Located at Hennur Main Road and catering to about 350 children from nearby areas, the school provides quality education; support services and raises awareness among the family members about children education.  ','09845186941','info@lovedalefoundation.org ','Ms. Jeny',NULL,'http://www.lovedalefoundation.org/','[\"https://media.licdn.com/mpr/mpr/p/1/005/0b7/094/16ae2fa.jpg\"]',NULL,13.02773690,77.56590271,NULL,' http://www.lovedalefoundation.org/','Provides top class education facilities to the marginalized children in  rural Bangalore. Catering to about 350 children from nearby areas, the school provides quality education and support services.\n','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/lovedale/lovedale_thumnail.jpg',2500,NULL,'2017-08-13 07:47:40'),(3129,'Shastri School For Deaf And Dumb','7, 5th main, 2nd cross, Shankarnagar, Opp. Ashoka height apartment, Mahalakshmi layout extension, Bengaluru, Karnataka 560096','We take care of 30 orphan, deaf & dumb children in our hostel assuming complete responsibility to meet their basic needs of education, food and shelter. More than 90 students are provided with free education.','09008184222','secretary@shastridds.com',NULL,NULL,'http://www.shastridds.com/','[\"http://static.wixstatic.com/media/abbf07_f77108ca7c5642c1bc25f81c148a9f1e.jpg\"]',NULL,13.01043230,77.46628100,NULL,'http://www.shastridds.com/','We take care of 40 orphan, deaf & dumb children in our hostel assuming complete responsibility to meet their basic needs of education, food and shelter. More than 90 students are provided with free education.','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/sastri_school/sastri_school.webp',200,NULL,'2017-08-13 07:48:19'),(3130,'Seva in Action','#36, S.T Bed layout,\nKoramangala, Bangalore','In the last 27 years, Seva-in action has helped thousands of persons with intellectual disabilities find livelihood by providing them with skill training and finding the right opportunities for them in the industry.\n\nIt received a National Award from the President of India for Empowerment of persons with disabilities. \n\nSeva-in-Action runs multiple livelihood units where persons with disabilities make handcrafts like paper covers, decor, candles etc.','08025520347','sevainaction@gmail.com','Ms. Vardha',NULL,'http://sevainaction.org/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/01.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/3.jpg\",\n \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO