eneedy.org\n',NULL,NULL,'www.serveneedy.org','[\"https://content4.jdmagicbox.com/comp/hyderabad/n7/040pxx40.xx40.160219210041.n8n7/catalogue/serve-needy-voluntary-organization-karkhana-hyderabad-7ia5o.jpg\", \"http://www.cinemapolitics.com/public_images/albums_images/2295-sanjjanaa-visits-serve-needy-voluntary-organization-secunderabad-(15).jpg\"]',NULL,17.45755870,78.43331950,NULL,NULL,NULL,NULL,0,NULL,'2017-06-23 08:38:01'),(3134,'Voice4Girls','10-2-9/18/D\nAC Guards,\nNear SBI Bank\nHyderabad - 500004\n','VOICE conducts activity-based camps in government and low-cost private schools where girls acquire critical knowledge, spoken English and life skills. VOICE Camps are conducted by motivated college students who are hired and trained intensively to impart our curriculum.\n','08688832042','voice@voice4girls.org\n',NULL,NULL,'http://voice4girls.org/','[\"https://voice4girls.files.wordpress.com/2015/05/10836263_1002329956460252_1561449571_n.jpg?w=820&h=312&crop=1\", \"http://voice4girls.org/wp-content/uploads/2016/04/what-we-do.jpg\", \"http://dickey.dartmouth.edu/sites/dickey.dartmouth.edu/files/styles/basic_article_slideshow/public/Piper%2C%20Eliana%20X13%203.JPG?itok=qjwlRlsB\"]',NULL,17.39827400,78.45914200,NULL,NULL,NULL,NULL,0,NULL,'2017-08-09 08:48:11'),(3135,'Maruti Orphanage For Girls','H.No: 28, Street No: 3,\nNear Jayaa Hospital, \nHMT Swarnapuri Colony, Miyapur, \nHyderabad - 500049\n','Maruthi old age and orphanage welfare society is a home for girls who are orphans, semi-orphans, abandoned and needy children from the slums and streets of Andhra pradesh and Telangana. We offer accommodation, food, education and medical help. \n','09652666696','maruthiorphanage29@gmail.com',NULL,NULL,'http://www.maruthiorphanage.org/','[\"https://content1.jdmagicbox.com/comp/hyderabad/w6/040pxx40.xx40.150601114722.r9w6/catalogue/maruthi-orphanage-for-girls-miyapur-hyderabad-pzwv7.jpg\", \"https://content4.jdmagicbox.com/comp/hyderabad/w6/040pxx40.xx40.150601114722.r9w6/catalogue/maruthi-orphanage-for-girls-miyapur-hyderabad-7z4t7.jpg\"]',NULL,17.51366790,78.27814470,NULL,NULL,NULL,NULL,0,NULL,'2017-06-23 09:03:59'),(3136,'The Toy Bank','T-3 Oberoi Apartments\nSham Nath Marg, Civil Lines\nDelhi - 110054','The Toy Bank as the name suggests houses toys. The Toy Bank collects toys, restores them and then distributes them to children who need them. Our Mission is to ?recycle toys- recycle smiles? on blooming young faces. We thrive hard towards this mission to help young generation to achieve its basic right to play with toys.','01123782233 ','mailthetoybank@gmail.com',NULL,NULL,'http://www.toybank.in','[\"https://lbb.in/delhi/wp-content/uploads/sites/1/2015/08/IMG_4716.jpg\", \"http://www.toybank.org/images/photos/Toytbank_Marathon2012_261.jpg\", \"http://2.bp.blogspot.com/-VOP_C8lbzpk/UDtj2xvKu9I/AAAAAAAAKPI/njb_E6NoSKg/s1600/8th_Birthday228.jpg\", \"https://3.bp.blogspot.com/-VdNA3-s6DbY/WBHiY2SDKjI/AAAAAAAAYJ0/7K38qqaSO_wEEew7MkI07rwO1XMuTQvqQCLcB/s1600/Rack%2BImage.jpg\"]',NULL,28.67697330,77.22278590,NULL,NULL,NULL,NULL,0,NULL,'2017-06-23 11:19:46'),(3137,'Om Foundation','Pacific Building, D-92, Sector-63,\nNoida. UP 201301','OM Foundation is a Noida-based registered, secular, gender-sensitive and humanitarian public charitable trust. Founded in the year 2002, the Foundation was set up to make significant contribution to the economically and socially disadvantaged citizens of India. \nOM Foundation aims to play a significant role in transforming the lives of the underprivileged children and other members of the underprivileged communities of India by empowering them with education, health care facilities and livelihood skills in the most professional, transparent and efficient manner.','9599227831','projects@omfoundation.in',NULL,NULL,'http://www.omfoundation.in/','[\"https://in.ambafrance.org/IMG/jpg/Web-Mme_Inde11.jpg?8510/bb4bbee08f288098a9a7774655bbd2b73a2be3c6\", \"http://3.bp.blogspot.com/-QGef-ZTm5Ro/UZGsUTUtlkI/AAAAAAAADTs/p_YPpeHAUgo/s1600/Photo3004.jpg\", \"http://1.bp.blogspot.com/--ZlUEq2rmZM/UKs0PkZD4_I/AAAAAAAAAnI/A-ZKg-vX6xM/s1600/6a0148c7283f78970c017c32300c54970b.jpg\", \"http://www.helpingbrainz.org/wp-content/uploads/2014/05/Om-Foundation-School-Noida-Gathering-143.JPG\"]',NULL,28.58145510,77.36487510,NULL,NULL,NULL,NULL,0,NULL,'2017-06-23 11:19:19'),(3138,'Rahi Foundation','B- 200 Chittaranjan Park, Second Floor, New Delhi- 110091','RAHI Foundation, established in 1996, is a pioneering organization focused on women survivors of Incest and Child Sexual Abuse (CSA). RAHI?s work includes support and recovery through the distinctive RAHI Model of Healing; awareness and education about Incest/ CSA; training and intervention; and research and capacity building - all established within the larger issue of social change.','01141607055','info@rahifoundation.org',NULL,NULL,'http://www.rahifoundation.org/about.html','[\"http://www.rahifoundation.org/images/programs/college_programs/summer_internship/20140228_123514.jpg\", \"http://www.ilead.net.in/ADMIN/IMAGES/OTH/Rahi%20Foundation%20Performs%20Out%20of%20Shadow_4.jpg\", \"http://www.ilead.net.in/ADMIN/IMAGES/OTH/Rahi%20Foundation%20Performs%20Out%20of%20Shadow_6.jpg\"]',NULL,28.58246330,77.18067260,NULL,NULL,NULL,NULL,0,NULL,'2017-06-23 11:18:37'),(3139,'Nanhi Kali','K. C. Mahindra Education Trust\nCecil Court\nNear Regal Cinema\nMahakavi Bhushan Marg\nMumbai 400001','Since 2005, Project Nanhi Kali is jointly managed by the K. C. Mahindra Education Trust and Naandi Foundation. . The project provides academic, material and social support that allows a girl child to access quality education, attend school with dignity and reduces the chances of her dropping out. Project Nanhi Kali is working with 19 NGO implementation partners at the grassroot level to ensure that the Nanhi Kalis receive academic, material support and social support. The K.C. Mahindra Education Trust regularly monitors the NGOs by giving technical inputs wherever required to ensure that quality education is being imparted to all the Nanhi Kalis.','02222852441','support@nanhikali.org',NULL,NULL,'http://www.nanhikali.org/','[\"https://flywithvip.com/media/uploads/2015/07/08/3a0b0c3.jpg\", \"http://www.wise-qatar.org/sites/default/files/styles/popin_image_style/public/assets/images/nanhi_kali_6.png?itok=S11In1Fn\", \"http://4.bp.blogspot.com/-chGLdtMaPgA/UM2807bvxxI/AAAAAAAAAEQ/UQIj6KQ7Hxw/s1600/nanhikaliNew.gif\"]',NULL,18.92431160,72.83003900,NULL,'http://www.nanhikali.org/','Provides academic, material and social support that allows a girl child to access quality education, attend school with dignity and reduces the chances of her dropping out.','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/nanhikali/nanhikali_thumpnail.jpg',300000,NULL,'2017-08-13 07:50:06'),(3140,'Muskaan','Plot #3, Sector B, \nVasant Kunj, New Delhi','Founded in 1982, Muskaan has touched lives of tens of thousands of persons with disabilities. It has been running many programs like adult training centres to teach life and vocational skills like candle, decor, jewellery making.\n\nMuskaan also provides family support services to help the family understand and accept the nature of the disability its impact on the person and the family.\n\nAlso Muskaan\'s employment services help persons with disabilities join the work force and earn livelihood.','01141761873',NULL,NULL,NULL,'http://www.muskaanthengo.org/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/muskaan/image1-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/muskaan/image2-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/muskaan/image3-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/muskaan/image4-min.png\"]',NULL,28.52532300,77.09208320,NULL,'http://www.muskaanthengo.org/','An adult training centre for people with intellectual disability.  Providing vocational and skill training, employment services and family support services, muskaan is empowering adults with intellectual disability for over 3 decades.','https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/muskaan/muskaan_thumbnail.jpg',2700,NULL,'2017-08-13 07:49:19'),(3141,'The Earth Saviours Foundation','Bandhwari Village, Near TERI Golf Course, Gurgaon','For the last decade the foundation has been running an old age home to look after homeless - abandoned senior citizens.\n\nSave-Earth also runs a rescue center to look after mentally disabled people and help in rehabilitating sexually abused and homeless females.\n\nAll the persons in these centres are provided love, support and care and timely medical care. ',' 01133083261','svearth@yahoo.com',NULL,NULL,'http://earthsaviours.in/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/theEarthSaviour/image2-min.png\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/theEarthSaviour/image3-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/theEarthSaviour/image4-min.jpg\"]',NULL,28.40639930,77.08116230,NULL,NULL,NULL,NULL,0,NULL,'2017-07-15 16:34:19'),(3142,'Bal Sahyog','Opposite L-Block Market, \nConnaught Circus, New Delhi','Bal Sahyog was founded by late Prime Minister, Smt. Indira Gandhi in 1954, for the care and protection of orphan, helpless, abandoned and neglected children.\n\nIt is serving thousands of children in its Home and Contact Centers in the slums of Delhi by \nproviding nutrition, health care, education and protection. \n\nIt is also supporting thousands of youth \nand women through vocational training, awareness, education, health services and gainful \nengagement/placement services etc.','01123411273','balsahyog@balsahyog.org.in',NULL,NULL,'http://www.balsahyog.org.in/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/BalSahyog/image1-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/BalSahyog/image2-min.jpeg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/BalSahyog/image3-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/BalSahyog/image4-min.jpg\"]',NULL,28.63484970,77.15213600,NULL,NULL,NULL,NULL,0,NULL,'2017-07-15 16:48:50'),(3143,'Uday foundation','113A/1, Adchini, \nSri Aurobindo Marg, New Delhi ','Uday foundation is working hard to help poor children with medical conditions. \n\nIt provides free food and dry ration and addresses health needs of underprivileged children and women through our dedicated health centre. \n\nThe foundation partners with hospitals in Delhi to conduct health camps at the slums and remote rural area.','01126561333','reena.sen@udayfoundationindia.org',NULL,NULL,' http://www.udayfoundationindia.org/','[\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/udayFoundation/image1-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/udayFoundation/image2-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/udayFoundation/image3-min.jpg\",\n\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/delhi/udayFoundation/image4-min.jpg\"]',NULL,28.53498800,77.19698300,NULL,NULL,NULL,NULL,0,NULL,'2017-07-15 16:37:25');
