INSERT INTO `causeDetailedView` VALUES (5625,'School fees for 3 kids from an orphanage.','Help Madhu Mansion Orphange to keep the 3 kids in school.',NULL,NULL,'[\"1\", \"23\", \"26\", \"25\", \"24\"]',NULL,NULL,'\n<html>\n<head>	\n<link rel=\"stylesheet\" type=\"text/css\" href=\'../utils/common.css\' />\n</head>\n<body>\n<div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n				<div class=\"campaign-story\">\n                    <style type=\"text/css\">\n                        /*on small screens coloumns are vertically stacked and we need gaps between vertical coloumns*/\n                        @media (max-width: 768px) {\n                          [class*=\"col-\"] {\n                              margin-bottom: 2em;\n                          }\n                        }\n                    </style>\n					\n<p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/03.jpg\" data-filename=\"288c981b96221dafea6a4f14b746fd86511b7768.jpg\" style=\"width: 960px; height: 576px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <h3>Home For Children With No Home.</h3>\n\n                    <p>\n                    Madhu mansion is a trust which runs an orphanage for children in Marathahalli area of Bangalore. \nMadhu Mansion cares for orphans, nurturing their childhood with high-quality education at a recognized school and  providing a safe and secure homely environment to them.\n                    </p>\n                    <br />\n\n                    <p>\nIt is run by Bro Samson.\nBro Samson provides for food, lodging and education of 30+ under privileged kids mostly on his own, supplementing with charitable donations.\nYou are all welcome to visit and celebrate your blessings with these kids and make some joy-filled memories.\nThe first unit of this orphanage is located close to Marathahalli, Whitefield, Kundalahalli, HAL or K R Puram.\n                    </p>\n                    <br />\n\n    <h3>Education</h3>\n    <p class=\"\">Trust believes that good education can help kids in the orphanage to maximize their potential and improve their lives. Hence the kids are sent to a good school nearby, which requires proper school uniform.Hence we need funds to get them white dresses. One school dress usually cost between Rs 500-1500, depending on kids age. Kids also indulge in lot of creative programs such as painting, handicrafts etc. Please do visit the orphanage and teach them more about these things as they are still learning</p><p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/2.jpg\" data-filename=\"5f4334ad0bd17403346ee4a25ebb74775d9533d2.jpeg\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <br />\n    <p>\n    Also if you have kids yourself, you can bring them along and celebrate your special occassions with the kids. As lot of people who have visited here have mentioned, kids are very welcoming and fun-loving.\n    </p>\n                    <br />\n    \n    <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/5.jpg\"\" data-filename=\"72d4751793a224b7c39648c9e85732b43cadfc1b.jpeg\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                </div>\n				</div>\n\n    <div class=\"row text-center\">\n        <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n            <div class=\"text-center\">\n                <a href=\"/ngos/madhu-mansion-charitable-trust.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n            </div>\n        </div>\n    </div> \n\n</body>\n</html>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/website_images/kids_study.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/01.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/whiteuni3.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]\n',NULL,NULL),(5626,'White uniform for 39 kids','Students at orphanage study at a school which mandates dress code, hence the orphanage needs donation to provide them with dresses.',NULL,NULL,'[\"1\",\"18\",\"6\",\"7\",\"8\",\"9\"]',NULL,NULL,'\n<html>\n<head>	\n<link rel=\"stylesheet\" type=\"text/css\" href=\'../utils/common.css\' />\n</head>\n<body>\n<div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n				<div class=\"campaign-story\">\n                    <link href=\"/css/ngos-style.css\" rel=\"stylesheet\" />\n					\n<p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/03.jpg\" data-filename=\"288c981b96221dafea6a4f14b746fd86511b7768.jpg\" style=\"width: 960px; height: 576px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <h3>Home For Children With No Home.</h3>\n\n                    <p>\n                    Madhu mansion is a trust which runs an orphanage for children in Marathahalli area of Bangalore. \nMadhu Mansion cares for orphans, nurturing their childhood with high-quality education at a recognized school and  providing a safe and secure homely environment to them.\n                    </p>\n                    <br />\n\n                    <p>\nIt is run by Bro Samson.\nBro Samson provides for food, lodging and education of 30+ under privileged kids mostly on his own, supplementing with charitable donations.\nYou are all welcome to visit and celebrate your blessings with these kids and make some joy-filled memories.\nThe first unit of this orphanage is located close to Marathahalli, Whitefield, Kundalahalli, HAL or K R Puram.\n                    </p>\n                    <br />\n\n    <h3>Education</h3>\n    <p class=\"\">Trust believes that good education can help kids in the orphanage to maximize their potential and improve their lives. Hence the kids are sent to a good school nearby, which requires proper school uniform.Hence we need funds to get them white dresses. One school dress usually cost between Rs 500-1500, depending on kids age. Kids also indulge in lot of creative programs such as painting, handicrafts etc. Please do visit the orphanage and teach them more about these things as they are still learning</p><p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/2.jpg\" data-filename=\"5f4334ad0bd17403346ee4a25ebb74775d9533d2.jpeg\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <br />\n    <p>\n    Also if you have kids yourself, you can bring them along and celebrate your special occassions with the kids. As lot of people who have visited here have mentioned, kids are very welcoming and fun-loving.\n    </p>\n                    <br />\n    \n    <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/5.jpg\"\" data-filename=\"72d4751793a224b7c39648c9e85732b43cadfc1b.jpeg\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                </div>\n				</div>\n\n    <div class=\"row text-center\">\n        <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n            <div class=\"text-center\">\n                <a href=\"/ngos/madhu-mansion-charitable-trust.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n            </div>\n        </div>\n    </div> \n\n</body>\n</html>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/whiteuni1.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/whiteuni2.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/madhu/whiteuni3.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]',NULL,NULL),(5630,'Healthy meal to underprivileged.','Buy meals for underpriviliged kids ',NULL,NULL,'[\"1\", \"10\",\"11\", \"12\",\"13\"]',NULL,NULL,'\n<html>\n<head>	\n<link rel=\"stylesheet\" type=\"text/css\" href=\'../utils/common.css\' />\n</head>\n<body>\n<div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n				<div class=\"campaign-story\">\n					\n<p style=\"text-align: center; display: block;\" class=\"\"><img src=\"http://manavcharities.in/wp-content/uploads/2016/02/12.jpg\" data-filename=\"288c981b96221dafea6a4f14b746fd86511b7768.jpg\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <h3>No child is left hungry</h3>\n\n                    <p>\n                    MANAV CHARITIES is a registered NGO – non-profitable-oriented secular organization working in the field of socio-economic, educational development and upliftment of down-trodden people of Karnataka and other part of the country, with this headquarters in Bangalore for over 14 years.\n\nManav Charities started as early as 1999 under the chief eminent of Karnataka with the vision purely to address the problems faced by the down-trodden, particularly women and children, who are totally neglected by the society.\n                    </p>\n                    <br />\n                    <h3>Nutritious Meal to Underprivileged Children</h3>\n                    <p>\nOne of their well known program is “Nutritious Meal Program”. Over 21,000 children living in slums and struggling to get a square meal are being provided nutritious meal every day throughout the year without a day’s break in about 19 locations of India.\n\nChildren are given ID Cards and coupons to ensure that the food reaches only them and not others in the slums. One can see and witness the beautiful scene of the children enjoying the tasty breakfast cooked, delivered and served by professional caterers. Between 7.30 A.M. – 8.30 A.M. The breakfast is provided all 365 days without a day’s break in 19 locations in India.\n\n                    </p>\n                    <br />\n\n    <p class=\"\">\n<b/>\n    <ul>Motivation</ul></b>\nWe are driven by selfless devotion and zeal…which enables us to work under any conditions and innumerable constraints. Today, we have our registered office at Bangalore and our project partners at Chennai, Hyderabad, Kolkata, Mumbai/Pune, Delhi/Meerut, Jamshedpur, with our network spread across the whole of India\n\n                    </p><p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manavf2.png\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                    <br />\nThe core objectives of the Charity is to strengthen the under privileged and economically backward rural population by providing them with better education and hence creating awareness amont them. This consistent and persistent implementation will bring about unprecedented improvement in the lives of rural citizens of India.\nOne of Nutritious Meal to Underprivileged Children campaign is aimed towards providing daily nutritious & hygienic Nutritious meals to poor underprivileged children across India. No Hungry Child Charities’ aim for this campaign is \"no child should be left hungry in India”. In a country where the rich-poor divide is stark and while millions splurge on good food, we find it unacceptable that even bigger millions of children have to go to bed hungry without any means for food or nutrition.\n    </p>\n                    <br />\n    \n    <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manavF1.png\"\" data-filename=\"72d4751793a224b7c39648c9e85732b43cadfc1b.jpeg\" style=\"width: 750px;\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                </div>\n				</div>\n\n</body>\n</html>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manav1.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manav2.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/manav/manav3.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]',NULL,NULL),(5632,'Empowering persons with disabalities','Help people with disabilities to lead a life of independence, with education and livelihood.',NULL,NULL,'[\"1\", \"23\", \"21\", \"22\"]',NULL,NULL,' <div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n            <div class=\"campaign-story\">\n                \n                <style type=\"text/css\">\n                        /*on small screens coloumns are vertically stacked and we need gaps between vertical coloumns*/\n                        @media (max-width: 768px) {\n                          [class*=\"col-\"] {\n                              margin-bottom: 2em;\n                          }\n                        }\n                        .marginTopExtra {\n                              margin-top: 2em;  \n                        }\n                        \n                        .marginTop {\n                              margin-top: 1em;  \n                        }\n                \n                    </style>\n                \n                <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/01.jpg\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Your support will help empower persons with disabilities.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"text-left\">\n                            Samarthanam runs multiple centres which house kids with disabilities\n                            who are provided shelter, food and education along with multiple livelihood centers\n                            to provide job skill trainings to persons with disabilities.\n                        </p>\n                        \n                        <div class=\"text-left marginTop\"><h4>Higher education support</h4></div>\n                        <p class=\"text-left\">\n                            \n                            \n                            Samarthanam helps the youth with disabilities pursue higher education and aids in attaining the highest degree\n                            the individual seeks to accomplish. Samarthanam provides practical support to more than 200 students in pursuing higher education each year\n                            paving way to successful careers.\n                        </p>\n                        <p class=\"text-left\">\n                            Samarthanam also runs a residential primary (established in 2008) and high school, located in HSR layout in Bengaluru and \n                            currently there are around 200 students in primary and 150 students in high School availing free education, food, uniforms,\n                            accommodation, medical facility, study support, tuition and training.\n                        </p>\n                         <div class=\"text-left marginTop\"><h4>Residential hostels</h4></div>\n                        <p class=\"text-left\">\n                            \n                            The hostels by Samarthanam provide shelter and hygienic food to disabled and underprivileged students.\n                            Separate hostels facilities are provided for girls and boys with every basic amenity. The facilities are equipped with\n                            computers and accessible technology making the life of residents and commuters hassle free.\n                        </p>\n                        \n                        <p class=\"lead text-left marginTopExtra\">\n                        <em><h4>All through the year, you would be provided with regular updates w.r.t the student\'s\n                        progress and the various programs and events by the NGO. </h4></em>\n                        </p>\n                    </div>\n                    \n                 </div>\n                </div>\n            \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    \n                    <h3>About the NGO: Samarthanam Trust for the disabled.</h3>\n                    <hr class=\"small\">\n                    <div class=\"marginTopExtra\"></div>\n                    <h3>An inclusive society free from discrimination where persons with disabilities become contributing members, living with dignity and respect.</h3>\n                    <div class=\"marginTop\"></div>\n                    <p class=\"text-left\">\n                        For the last 20 years, Samarthanam has been helping person\'s with disabilities and providing\n                        them home, education and livelihood training. Today, it works across 10 offices,\n                        across 4 states, implementing 7 major programmes impacting the lives of over 25,000\n                        people directly and indirectly with its services every year.\n                    </p>\n                    \n                 </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Multiple National awards from President of India.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"lead text-left\">\n                            It has won National Award from the President of India for its exemplary work in child welfare in\n                            2009 and 2013.\n                        </p>\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_nation2009.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_national_award2013-min.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"text-center\">\n                            <a href=\"/ngos/samarthanam-trust-for-disabled.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n                        </div>\n                    </div>\n                </div>       \n        </div>\n    </div>\n \n \n   <script>\n           alert(\"hello\");\n           \n   </script>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/1.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/website_images/samarthanam.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/3.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]',NULL,NULL),(5633,'Skill development for intellectual disabilities','Join this NGO to help automate livelihood centers for persons with intellectual disabilities.',NULL,NULL,'[\"1\", \"23\", \"29\", \"28\", \"27\"]',NULL,NULL,'  \n        <div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n            <div class=\"campaign-story\">\n                <style type=\"text/css\">\n                        /*on small screens coloumns are vertically stacked and we need gaps between vertical coloumns*/\n                        @media (max-width: 768px) {\n                          [class*=\"col-\"] {\n                              margin-bottom: 2em;\n                          }\n                        }\n                        .marginTopExtra {\n                              margin-top: 2em;  \n                        }\n                        \n                        .marginTop {\n                              margin-top: 1em;  \n                        }\n                \n                    </style>\n                <!--<p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/siavolunt2.png\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                -->\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 \">\n                        <div class=\"col-md-6 col-lg-offset-3\">\n                                 <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/to_automate.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                        </div>\n                    </div>\n                </div>\n                \n                \n                <div class=\"row text-center marginTopExtra\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Your support will help persons with intellectual disabilities make a livelihood.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"text-left\">\n                            Seva-in-action is an national award winning NGO based out of Banaglore, which is empowering\n                            persons with intellectual disabilities for the last three decades.\n                        </p>\n                        \n                        <div class=\"text-left marginTop\"><h4>Rachna</h4></div>\n                        <p class=\"text-left\">\n                            \n                            Rachana, an initiative of Seva-in-Action was initiated in 2010\n                            with the intention of gainfully engaging intellectually disabled\n                            adults and thereby providing the skills and confidence to work through\n                            production activity.\n                        </p>\n                        \n                    </div>\n                    \n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Products currently made at Rachana</h3>\n                    <hr class=\"small\">\n                        <div class=\"col-md-6 col-lg-offset-3\">\n                            <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/siavolunt3.png\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                        </div>\n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <p class=\"text-left\">\n                            All the products hand made by persons with intellectual disabilities with guidance\n                            from vounteers at the NGO. These items are environmentally friendly,\n                            very often reusing papers, clothes for cloth bags\n                            in different sizes, old flowers to make rangoli colors etc.\n                        </p>\n                    </div>\n                </div>\n                \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <h3>Automation of proccess to make handcrafts.</h3>\n                        <p class=\"text-left\">\n                        Currently almost every step of the handcraft making is done manually.\n                        It takes many man-hours to make a simple cotton bag or candle and the\n                        output from it is not being enough to provide and completely sustainable\n                        livelihood to persons with disabilities.\n                        </p>\n                        <div class=\"marginTopExtra\">\n                            <p class=\"text-left\"><em> Seva-in-Action is trying hard to procure automation machines so that\n                            the process can be made effecient and have the repetative tasks be automated.</em></p>\n                        </div>\n                        \n                    </div>\n                </div>\n                    \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/sewing.jpg\" />\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/crusher.jpg\" />\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/machine.jpg\" />\n                        </div>\n                            \n                    </div>\n                </div>\n                    \n               \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    \n                        <h3>About the NGO: Seva In Action.</h3>\n                        <hr class=\"small\">\n                        <div class=\"marginTopExtra\"></div>\n                        <h3> Providing livelihood for persons with intellectual disabilities.</h3>\n                        <div class=\"marginTop\"></div>\n                        <p class=\"text-left\">\n                                In the last 27 years, Seva-in action has helped thousands of persons with \n                                intellectual disabilities find livelihood by providing them with skill\n                                training and finding the right opportunities for them in the industry.\n                        </p>\n                    \n                    </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>National awards from President of India.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"lead text-left\">\n                            Seva-in -Action received a National Award from the President of India for\n                            Empowerment of persons with disabilities.\n                        </p>\n                    </div>\n                    <div class=\"col-md-6 col-lg-offset-3\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/award.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                    \n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"text-center\">\n                            <a href=\"/ngos/seva-in-action.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n                        </div>\n                    </div>\n                </div>       \n        </div>\n    </div>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/sia.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bags_on_table.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/craft_making.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]',NULL,NULL),(5637,'Handicrafts made by intellectually disabled people','Contribute to get products hand-made from recycled items by persons with intellectual disabilities and help bring about their economic empowerment.\n','Seva-in-Action (SiA) was founded in the year 1985 to minimize the gap between needs and opportunities for persons with disabilities specifically in rural Karnataka. The objective was empowering families and persons with disabilities to find within their community, provisions and opportunities for their children through CBR projects. SIA was registered under the societies act in 1992. SiAâ€™s work is primarily in the field of inclusion of children and adults with disabilities in education, employment and all other spheres of development to ensure their human rights SIA works closely with the government system to implement its policies at grassroots level and also for policy development based on the local context. Since 1998 SiA has been involved with the education department at state and national level in capacity building of the system through its teacher education programmes, policy planning and evaluation of projects in the area of inclusive education. SiA has a consultative status with MHRD. SiA has been appointed as State Nodal Agency Center. (SNAC) under National Trust (MSJ &E) GOI. Over the years the organization has grown from a service delivery to training, resource and research center under the banner of Action for Inclusion.         \\nRachana is an initiation by SiA in 2008 to bring about the economic empowerment of adults with disabilities. It was envisaged to be managed by adults with disabilities with the support of parents. Now it is time for SiA to transfer the responsibility of managing the unit to the members of Rachana with the support of parent group and to ensure a better & higher income for them to make them economically independent and socially confident and secure.\\nObjectives of the Project:\\nTo make the Production unit into a profit making business enterprise and thereby turn the disabled members of Kalika and Rachana economically independent, socially confident and secured.\\nTo involve the parents and volunteers more actively in the process.\\nTo ease out the responsibility of SiA staff in the production unit so that they can focus better on Vocational Training and other projects of the organisation.\\nTo ensure regular and higher income to the Rachana team and also to create job opportunity for many other abled adults.\\nAlready formation of parents group is being under process through conducting number of meetings and discussing issues involved in developing Rachana as a profit making unit with the parents group. The few enthusiastic parents are visiting other parents group and persons to understand the development in this field so that they can learn from them. However the process cannot happen overnight, it will take its own time.\\nPADA -PARENTS ASSOCIATION FOR DIFFERENTLY ABLED ADULTS\\nPADA is an initiative of Seva-in-Action towards forming   a parents group of adults with intellectual disabilities. This group has29 members and is registered under the societyâ€™s Act. PADAâ€™s objective is to empower adults with disabilities and enable them to be economically independent so that when the parents are not there they can take care of themselves with the help of the society.\\n\\n                   \\n',NULL,'[\"1\",\"4\", \"2\",\"3\",\"5\"]',NULL,NULL,'<div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n            <div class=\"campaign-story\">\n                <style type=\"text/css\">\n                        /*on small screens coloumns are vertically stacked and we need gaps between vertical coloumns*/\n                        @media (max-width: 768px) {\n                          [class*=\"col-\"] {\n                              margin-bottom: 2em;\n                          }\n                        }\n                        .marginTopExtra {\n                              margin-top: 2em;  \n                        }\n                        \n                        .marginTop {\n                              margin-top: 1em;  \n                        }\n                \n                    </style>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"col-md-6 col-lg-offset-3\">\n                                 <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/siavolunt2.png\" style=\"width:100%; max-width: 100%; height: auto;\">\n                        </div>\n                    </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Your support will help persons with intellectual disabilities make a livelihood.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"text-left\">\n                            Seva-in-action is an national award winning NGO based out of Banaglore, which is empowering\n                            persons with intellectual disabilities for the last three decades.\n                        </p>\n                        \n                        <div class=\"text-left marginTop\"><h4>Rachna</h4></div>\n                        <p class=\"text-left\">\n                            \n                            Rachana, an initiative of Seva-in-Action was initiated in 2010\n                            with the intention of gainfully engaging intellectually disabled\n                            adults and thereby providing the skills and confidence to work through\n                            production activity.\n                        </p>\n                        \n                    </div>\n                    \n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Products currently made at Rachana</h3>\n                    <hr class=\"small\">\n                        <div class=\"col-md-6 col-lg-offset-3\">\n                            <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/siavolunt3.png\" style=\"width:100%; max-width: 100%; height: auto;\">\n                        </div>\n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <p class=\"text-left\">\n                            All the products hand made by persons with intellectual disabilities with guidance\n                            from vounteers at the NGO. These items are environmentally friendly,\n                            very often reusing papers, clothes for cloth bags\n                            in different sizes, old flowers to make rangoli colors etc.\n                        </p>\n                    </div>\n                </div>\n                \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <h3>Cloth bags: Ideal as lunch or grocery bag</h3>\n                        <p class=\"text-left\">\n                        These bags are fully hand-made and made from paper and reused cloths.\n                        The dimentions of the bag is 30X20X78 cms. These are very durable and sturdy.\n                        They can be used to carry lunch to office or can be used as gift bags.\n                        </p>\n                    </div>\n                </div>\n                    \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_fabric_small-min.jpg\">\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_top_small-min.jpg\">\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_with_luch_box_small-min.jpg\">\n                        </div>\n                            \n                    </div>\n                </div>\n                    \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <h3>Gel Candles: Ideal for home decoration.</h3>\n                        <p class=\"text-left\">\n                            These candles made at the Koramangala centre of seva-in-action are made with love\n                            by intelectually disabled persons. The candles are neatly done with rose petals\n                            from reused flowers.\n                            The glass candles are last 6-8 hours and add to the beautify of your home.\n                        </p>\n                    </div>\n                </div>\n                    \n                <div class=\"row text-left\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTop\">\n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/candle_cause_min.jpg\">\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/candle_top_small-min.jpg\">\n                        </div>\n                        \n                        <div class=\"col-md-3 col-lg-offset-1\">\n                             <img class=\"handcraftImages\" src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/candle_vertical_small-min.jpg\">\n                        </div>   \n                    </div>\n                </div>\n            \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    \n                        <h3>About the NGO: Seva In Action.</h3>\n                        <hr class=\"small\">\n                        <div class=\"marginTopExtra\"></div>\n                        <h3> Providing livelihood for persons with intellectual disabilities.</h3>\n                        <div class=\"marginTop\"></div>\n                        <p class=\"text-left\">\n                                In the last 27 years, Seva-in action has helped thousands of persons with \n                                intellectual disabilities find livelihood by providing them with skill\n                                training and finding the right opportunities for them in the industry.\n                        </p>\n                    \n                    </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>National awards from President of India.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"lead text-left\">\n                            Seva-in -Action received a National Award from the President of India for\n                            Empowerment of persons with disabilities.\n                        </p>\n                    </div>\n                    <div class=\"col-md-6 col-lg-offset-3\">\n                         <img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/award.jpg\" style=\"width:100%; max-width: 100%; height: auto;\">\n                    </div>\n                    \n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"text-center\">\n                            <a href=\"/ngos/seva-in-action.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n                        </div>\n                    </div>\n                </div>       \n        </div>\n    </div>','[\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_vertical_cause-min.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_with_books_cause_min.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/bag_fabric_cause-min.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/candl1-min.JPG\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Seva-in-action/candle_on_plate.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n}\n]','{\n\"imageurl\": \"http://www.onegoodstep.org/wp/wp-content/uploads/2015/04/DSC_0534.jpg\",\n\"title\": \"this is title of image\",\n\"subtitle\": \"this is subtitle of image\"\n},\n{\n\"imageurl\": \"http://www.onegoodstep.org/wp/wp-content/uploads/2015/04/DSC_0534.jpg\",\n\"title\": \"this is title of image\",\n\"subtitle\": \"this is subtitle of image\"\n}',NULL),(5638,'none','Help people with disabilities to lead a life of independence, from education to livelihood.',NULL,NULL,'[\"1\"]',NULL,NULL,' <div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n            <div class=\"campaign-story\">\n                \n                <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/01.jpg\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Your support will help empower persons with disabilities.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"text-left\">\n                            Samarthanam runs multiple centres which house kids with disabilities\n                            who are provided shelter, food and education along with multiple livelihood centers\n                            to provide job skill trainings to persons with disabilities.\n                        </p>\n                        \n                        <div class=\"text-left marginTop\"><h4>Higher education support</h4></div>\n                        <p class=\"text-left\">\n                            \n                            \n                            Samarthanam helps the youth with disabilities pursue higher education and aids in attaining the highest degree\n                            the individual seeks to accomplish. Samarthanam provides practical support to more than 200 students in pursuing higher education each year\n                            paving way to successful careers.\n                        </p>\n                        <p class=\"text-left\">\n                            Samarthanam also runs a residential primary (established in 2008) and high school, located in HSR layout in Bengaluru and \n                            currently there are around 200 students in primary and 150 students in high School availing free education, food, uniforms,\n                            accommodation, medical facility, study support, tuition and training.\n                        </p>\n                         <div class=\"text-left marginTop\"><h4>Residential hostels</h4></div>\n                        <p class=\"text-left\">\n                            \n                            The hostels by Samarthanam provide shelter and hygienic food to disabled and underprivileged students.\n                            Separate hostels facilities are provided for girls and boys with every basic amenity. The facilities are equipped with\n                            computers and accessible technology making the life of residents and commuters hassle free.\n                        </p>\n                        \n                        <p class=\"lead text-left marginTopExtra\">\n                        <em><h4>All through the year, you would be provided with regular updates w.r.t the student\'s\n                        progress and the various programs and events by the NGO. </h4></em>\n                        </p>\n                    </div>\n                    \n                 </div>\n                </div>\n            \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    \n                    <h3>About the NGO: Samarthanam Trust for the disabled.</h3>\n                    <hr class=\"small\">\n                    <div class=\"marginTopExtra\"></div>\n                    <h3>An inclusive society free from discrimination where persons with disabilities become contributing members, living with dignity and respect.</h3>\n                    <div class=\"marginTop\"></div>\n                    <p class=\"text-left\">\n                        For the last 20 years, Samarthanam has been helping person\'s with disabilities and providing\n                        them home, education and livelihood training. Today, it works across 10 offices,\n                        across 4 states, implementing 7 major programmes impacting the lives of over 25,000\n                        people directly and indirectly with its services every year.\n                    </p>\n                    \n                 </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Multiple National awards from President of India.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"lead text-left\">\n                            It has won National Award from the President of India for its exemplary work in child welfare in\n                            2009 and 2013.\n                        </p>\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_nation2009.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_national_award2013-min.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"text-center\">\n                            <a href=\"/ngos/samarthanam-trust-for-disabled.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n                        </div>\n                    </div>\n                </div>       \n        </div>\n    </div>',NULL,NULL,NULL),(5655,'Adopt a kid with disability for a year.','Your support will help meet one kid\'s overall expenses for one year.',NULL,NULL,'[\"1\",\"18\", \"14\",\"19\",\"17\", \"20\"]',NULL,NULL,'\n        <div id=\"campaignOverview\" class=\"content-section content-overview well clearfix singleUpdate\" style=\"background-color: white; font-size: 20px;\">\n            <div class=\"campaign-story\">\n                \n                <style type=\"text/css\">\n                        /*on small screens coloumns are vertically stacked and we need gaps between vertical coloumns*/\n                        @media (max-width: 768px) {\n                          [class*=\"col-\"] {\n                              margin-bottom: 2em;\n                          }\n                        }\n                        .marginTopExtra {\n                              margin-top: 2em;  \n                        }\n                        \n                        .marginTop {\n                              margin-top: 1em;  \n                        }\n                \n                    </style>\n                \n                <p style=\"text-align: center; display: block;\" class=\"\"><img src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/01.jpg\" class=\" b-lazy b-loaded animated fadeIn\"><br></p>\n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Your support will help meet one kid\'s overall expenses for one year.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"text-left\">\n                            Samarthanam runs a residential primary (established in 2008) and high school, located in HSR layout in Bengaluru and are\n                            recognized by Karnataka State Board of Education.\n                        </p>\n                        <p class=\"text-left\">\n                            Currently there are around 200 students in primary and 150 students in high School availing free education, food, uniforms,\n                            accommodation, medical facility, study support, tuition and training.\n                        </p>\n                        <p class=\"text-left\">\n                            To ensure holistic development of the students, we facilitate free tuition & accommodation,\n                            study support through volunteers, training in extracurricular activities,\n                            accessible infrastructure, study material in digital format and so on.\n                        </p>\n                        \n                        <p class=\"lead text-left marginTopExtra\">\n                        <em><h4>All through the year, you would be provided with regular updates w.r.t the student\'s\n                        progress and we can arrange for your visit to meet the kid. </h4></em>\n                        </p>\n                    </div>\n                    \n                 </div>\n                </div>\n            \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    \n                    <h3>About the NGO: Samarthanam Trust for the disabled.</h3>\n                    <hr class=\"small\">\n                    <div class=\"marginTopExtra\"></div>\n                    <h3>An inclusive society free from discrimination where persons with disabilities become contributing members, living with dignity and respect.</h3>\n                    <div class=\"marginTop\"></div>\n                    <p class=\"text-left\">\n                        For the last 20 years, Samarthanam has been helping person\'s with disabilities and providing\n                        them home, education and livelihood training. Today, it works across 10 offices,\n                        across 4 states, implementing 7 major programmes impacting the lives of over 25,000\n                        people directly and indirectly with its services every year.\n                    </p>\n                    \n                 </div>\n                </div>\n                \n                \n                <div class=\"row text-center\">\n                 <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                    <h3>Multiple National awards from President of India.</h3>\n                    <hr class=\"small\">\n                    <div>\n                        <p class=\"lead text-left\">\n                            It has won National Award from the President of India for its exemplary work in child welfare in\n                            2009 and 2013.\n                        </p>\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_nation2009.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                    <div class=\"col-md-4 col-lg-offset-1\">\n                         <img  src=\"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarthanam_national_award2013-min.jpg\" style=\"width:100%; max-width: 100%; height: auto;\" />\n                    </div>\n                 </div>\n                </div>\n                \n                <div class=\"row text-center\">\n                    <div class=\"col-md-10 col-lg-offset-1 marginTopExtra\">\n                        <div class=\"text-center\">\n                            <a href=\"/ngos/samarthanam-trust-for-disabled.php\" role=\"button\" class=\"btn btn-lg btn-info\">More about the NGO</a>\n                        </div>\n                    </div>\n                </div>       \n        </div>\n    </div>','[\n\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarth2.png\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarth3.png\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/samarth1.jpg\",\n\"title\": \"\",\n\"subtitle\": \"\"\n},\n{\n\"imageurl\": \"https://storage.googleapis.com/bonsai-b808c.appspot.com/NGO_cause_images/Samarthanam/same3.jpg\",\n\"title\": \"Blind T20 cricket champions\",\n\"subtitle\": \"Saurav Ganguly with CEO of Samarthanam\"\n}\n\n]',NULL,NULL);
