INSERT INTO `smsPatterns` VALUES (1,'CITIBK','{\n	\"pattern\": \"Rs([\\s0-9.,]*) was spent on your ([a-zA-Z\\s]*) Card ([0-9a-zA-Z]*) on (.*) at (.*).\",\n	\"cost\": \"$1\",\n	\"type\": \"Citi $2 card\",\n	\"cardNum\": \"$3\",\n	\"date\": \"$4\",\n	\"place\": \"$5\"\n}',NULL,'2017-05-09 14:38:40'),(2,'SBICRD','{\n	\"pattern\": \"Transaction of Rs.([0-9.]*) made on ([a-zA-z\\s]*) ([A-Z0-9]*) at (.*) on (.*)\",\n	\"cost\": \"$1\",\n	\"type\": \"$2\",\n	\"cardNum\": \"$3\",\n	\"date\": \"$5\",\n	\"place\": \"$4\"\n}',NULL,'2017-04-10 01:20:49'),(3,'CITIBK','{\n	\"pattern\": \"(.*)([0-9.,\\s]*) INR was spent on your ([a-zA-Z\\s]*) Card ([0-9a-zA-Z]*) on (.*) at (.*).(.+)\",\n	\"cost\": \"$2\",\n	\"type\": \"Citi $3 card\",\n	\"cardNum\": \"$4\",\n	\"date\": \"$5\",\n	\"place\": \"$6\"\n}',NULL,'2017-05-09 14:38:40'),(4,'CITIBK','{\n	\"pattern\": \"^Your ([a-zA-Z\\s]*) card ([0-9a-zA-Z]*) has been used to make a purchase of Rs.([0-9.,\\s]*) at (.+) on (.*)$\",\n	\"cost\": \"$3\",\n	\"type\": \"Citi $1 card\",\n	\"cardNum\": \"$2\",\n	\"date\": \"$5\",\n	\"place\": \"$4\"\n}',NULL,'2017-05-09 14:38:40'),(5,'HDFCBK','{\n	\"pattern\": \"(.*)Thank you for using ([a-zA-Z]*) Card ending ([0-9a-zA-Z]+) for Rs.([0-9.]+) in (.*) at (.+) on (.+) Avl(.*)\",\n	\"cost\": \"$4\",\n	\"type\": \"HDFC $2 card\",\n	\"cardNum\": \"$3\",\n	\"date\": \"$7\",\n	\"place\": \"$6\"\n}',NULL,'2017-04-18 15:42:39'),(6,'ICICIBK','{\n	\"pattern\": \"Dear Customer, You have made a ([a-zA-Z]*) Card purchase of INR([0-9.]*) on (.*). Info.VPS*(.*). Your (.*)\",\n	\"cost\": \"$2\",\n	\"type\": \"ICICI $1 card\",\n	\"cardNum\": \"\",\n	\"date\": \"$3\",\n	\"place\": \"$4\"\n}',NULL,'2017-04-18 00:42:59'),(7,'ICICIBK','{\n	\"pattern\": \"Dear Customer, You have made a ([a-zA-Z]*) Card purchase of INR([0-9.]*) on (.*). Info.VPS*(.*).\",\n	\"cost\": \"$2\",\n	\"type\": \"ICICI $1 card\",\n	\"cardNum\": \"\",\n	\"date\": \"$3\",\n	\"place\": \"$4\"\n}',NULL,'2017-04-15 20:21:07'),(8,'BOIIND','{\n	\"pattern\": \"BOI Star Sandesh Rs ([0-9.]*) has been Debited to Your Account ([0-9a-zA-Z]*) from POS-(.*) On (.*).Available Balance (.*)\",\n	\"cost\": \"$1\",\n	\"type\": \"Bank Of India\",\n	\"cardNum\": \"$2\",\n	\"date\": \"$4\",\n	\"place\": \"$3\"\n}',NULL,'2017-04-15 20:21:07'),(9,'CITIBK','{\n	\"pattern\": \"Your ([a-zA-Z\\s]*) card ([0-9a-zA-Z]*) has been used to make a purchase of Rs.([0-9.]*) on (.+) at (.*)\",\n	\"cost\": \"$3\",\n	\"type\": \"Citi $1 card\",\n	\"cardNum\": \"$2\",\n	\"date\": \"$4\",\n	\"place\": \"$5\"\n}',NULL,'2017-04-15 20:21:07'),(10,'ipaytm','{\n	\"pattern\": \"(.*)You paid (.*) Rs[.\\s]*([0-9.]+)\\. (.*)\",\n	\"cost\": \"$3\",\n	\"type\": \"Paytm Wallet\",\n	\"cardNum\": \"NA\",\n	\"date\": \"NA\",\n	\"place\": \"$2\"\n}',NULL,'2017-06-21 06:32:21'),(11,'ipaytm','{\n	\"pattern\": \"(.*)Paid Rs.([0-9.]+) to (.*) at (.*). Wallet txn (.*)\",\n	\"cost\": \"$2\",\n	\"type\": \"Paytm Wallet\",\n	\"cardNum\": \"NA\",\n	\"date\": \"NA\",\n	\"place\": \"$3\"\n}',NULL,'2017-04-30 23:36:39'),(12,'ipaytm','{\n	\"pattern\": \"You have made a payment of Rs[.\\s]*([0-9.]+) at (.*) for Order (.*)\",\n	\"cost\": \"$1\",\n	\"type\": \"Paytm Wallet\",\n	\"cardNum\": \"NA\",\n	\"date\": \"NA\",\n	\"place\": \"$2\"\n}',NULL,'2017-04-30 23:36:39'),(14,'HDFCBK','{\n	\"pattern\": \"(.*)Rs.([0-9.\\s,]+) was spent on ur (.*) ending (.*) on (.*) at (.*)Avl(.*)\",\n	\"cost\": \"$2\",\n	\"type\": \"$3\",\n	\"cardNum\": \"$4\",\n	\"date\": \"$5\",\n	\"place\": \"$6\"\n}',NULL,'2017-05-09 14:44:54'),(15,'YESBNK','{\n	\"pattern\": \"(.*)Rs.([0-9.\\s,]+) was spent on ur (.*) ending (.*) on (.*) at (.*)Avl(.*)\",\n	\"cost\": \"$2\",\n	\"type\": \"$3\",\n	\"cardNum\": \"$4\",\n	\"date\": \"$5\",\n	\"place\": \"$6\"\n}',NULL,'2017-06-21 06:33:37');
